import React from 'react';
import { Link, NavLink } from 'react-router-dom';
import { TbHome } from "react-icons/tb";
import { TbDoorEnter } from "react-icons/tb";
import { TbDoorExit } from "react-icons/tb";


const Header = () => {
    return (
        <header>
            <h1>
                <Link to="/">Kişisel Gider Takip Uygulaması</Link>
            </h1>
            <nav>
                <ul>
                    <li><NavLink to="/">Anasayfa <TbHome /></NavLink></li>
                    <li><NavLink to="/income">Gelir <TbDoorEnter /></NavLink></li>
                    <li><NavLink to="/expenses">Gider <TbDoorExit /></NavLink></li>
                </ul>
            </nav>
        </header>
    );
};

export default Header;
